import React from 'react'
import PropTypes from 'prop-types'


const Title = ({title}) => {
   return (
    <nav>
        <h1 className='navbar bg-light'>
            {title}
        </h1>
   </nav>
      
  )
}

Title.propTypes = {
  title: PropTypes.string.isRequired,
};

export default Title
